==English==
===Noun===
{{head|en|noun form}}
# {{plural of|en|yellow}}
# {{lb|en|archaic}} A kind of [[jaundice]] found in [[horse]]s, [[cattle]], and [[sheep]], causing [[yellowness]] of the [[eye]]s.
# {{lb|en|archaic}} A disease of [[plant]]s, especially [[peach]] [[tree]]s, in which the [[leaf|leaves]] turn a yellowish colour.
===Verb===
{{head|en|verb form}}
# {{en-third-person singular of|yellow}}
#: ''This paper '''yellows''' with age and gets brittle.''
